    <title>数组去重复</title>
    <script src="https://cdn.bootcss.com/jquery/2.1.1/jquery.min.js"></script>
    <script>
        $(function () {
            (function (x, y) {
                alert(x + y);
            })(2, 3);
            var date = new Date();
            var n = date.toISOString();
            console.log(n);
        })
    </script>
</head>
